import logo from './feliciano.png';
import './App.css';

function App() {
  return (
    <div className="header">
       <h1>Logo</h1>
       <nav>
          <ul>
            <li>Home</li>
            <li>About</li>
            <li>Project</li>
            <li>Contact</li>
          </ul>
       </nav>

    </div>
  );
}

export default App;
